INSERT INTO `exam_questions` VALUES (1,'2022-09-05 11:39:27','2023-05-18 01:38:53',1,'R22018','題組一','Person A\nI work as a video game designer, and a quiet workspace is essential when I create stories and characters. Therefore, I definitely prefer closed office space where distractions are fewer. I won’t have to worry if someone would show up out of nowhere, wishing to speak with me but ending up interrupting my work. In fact, this is the main reason that I asked to transfer to my current office. I used to work in the main office which has a completely open space without walls. After realizing how it affected my concentration level and productivity, I applied for the transfer to a closed office space and couldn’t be happier with my decision.\n\nPerson B\nMy business partners and I knew that we needed an open office space when we started the company two years ago. For one thing, we wanted to stay more connected with our staff and to make ourselves available for communication. Another reason is we believed that removing physical barriers in the office space would encourage employees to collaborate; they would be more open to exchange ideas and ask for assistance. Looking back, I think we’ve made the right decision because we have had many brilliant product ideas resulted from brainstorming sessions and informal group conversations in this open space. \n\nPerson C\nMany people look at the choice between open or closed office space from the perspective of teamwork or productivity, but I have a different concern. I think closed office space is healthier for employees, both physically and emotionally. On the one hand, closed office space helps keep germs from fast spreading and therefore provides employees with increased physical health safety. On the other hand, closed office space improves employees’ emotional wellbeing by reducing their stress levels since there’s no need to appear in constant productivity.\n\nPerson D\nI don’t have personal preference for office space, but I can understand why our boss wanted to remove the walls. To begin with, open office space seems significantly cost-effective in terms of set-up and operation. No individual desks or other office equipment need to be purchased, and air conditioning and cleaning the space are more efficient. Also, without walls, the office space can easily be redesigned as required. This is especially important for a growing company like us, because the teams would still have space when expanding without feeling that the office becomes overcrowded too quickly.',99),(2,'2022-09-13 14:39:26','2022-10-11 00:25:15',1,'R22019','題組二','Online shopping\nPerson A\nI think the biggest benefit of online shopping is its convenience. There are basically no business hours in the digital space, which means it\'s easy to fit online shopping into my busy schedule. As a nurse, I often have different work shifts. With online shopping, I don\'t have to plan my purchases based on when a real store is open. I can also buy anything I want from the comfort of my home without having to go out or travel long distance. Online stores can be accessible from almost anywhere with internet access. \nPerson B\nI am not comfortable about shopping online because of the growing number of criminals who pretend to be legal sellers. For example, some criminals create fake websites or fake ads to steal shoppers’ credit card or bank account information. The problem gets even worse on social media where not only fake ads but fake products are also common. Although it’s easy to report online shopping crimes to the authorities, the shopping experiences can still be too unpleasant to bear. \nPerson C\nI prefer getting what I want immediately when shopping, but online sellers often force shoppers to wait days or longer for the order to arrive. Online purchases also cost more. To begin with, shoppers are generally required to make a minimum purchase to qualify for free shipping, which often means buying more than needed. In addition, many online stores or sellers use digital strategies such as ‘limited time’ sales pop-up messages to convince shoppers to buy more. Moreover, if shoppers are not satisfied with their purchases, they will be charged for shipping when returning the products.\nPerson D\nI shop online more often now because I like to find details about a product before making a purchase. In the past, I usually had to speak to store clerks in person for detailed product descriptions, which can be time-consuming sometimes. But now, all those can be done in just a few clicks. I can also access to reviews from other shoppers to help me make a more informed purchasing decision. In addition, because products in the digital space are not limited to shelves, I can enjoy a wider selection of products.',99),(3,'2023-04-27 11:16:37',NULL,2,'R23023','0428驗收用','0428驗收用',15),(4,'2023-05-07 11:23:51',NULL,3,'E22082','國教院-貽婷','國教院-貽婷',15),(5,'2023-05-10 11:27:00',NULL,4,'E22082','國教院-貽婷','國教院-貽婷',15),(6,'2023-05-10 11:27:20',NULL,5,'E22082','國教院-貽婷','國教院-貽婷',15),(7,'2023-05-10 11:23:51',NULL,6,'E22082','客戶需求','客戶需求',15),(8,'2023-05-10 11:23:51',NULL,7,'E22082','客戶需求','客戶需求',15),(9,'2023-05-22 08:17:57',NULL,8,'R22018','2023年5月預試','2023年5月預試',15),(10,'2023-05-22 08:18:18',NULL,8,'R22019','2023年5月預試','2023年5月預試',15),(11,'2023-05-22 08:50:14',NULL,9,'R22018','2023年5月預試','2023年5月預試',15),(12,'2023-05-22 08:50:33',NULL,9,'R22019','2023年5月預試','2023年5月預試',15),(13,'2023-05-28 16:17:57',NULL,10,'R22018','2023年5月預試','2023年5月預試',15),(14,'2023-05-28 16:18:08',NULL,10,'R22019','2023年5月預試','2023年5月預試',15),(15,'2023-05-28 16:18:46',NULL,11,'R22018','2023年5月預試','2023年5月預試',15),(16,'2023-05-28 16:18:56',NULL,11,'R22019','2023年5月預試','2023年5月預試',15),(17,'2023-05-28 16:19:15',NULL,12,'R22018','2023年5月預試','2023年5月預試',15),(18,'2023-05-28 16:19:23',NULL,12,'R22019','2023年5月預試','2023年5月預試',15),(19,'2023-06-07 12:38:17',NULL,13,'R22018','2023年5月預試','2023年5月預試',15),(20,'2023-06-07 12:38:29',NULL,13,'R22019','2023年5月預試','2023年5月預試',15),(21,'2023-08-29 00:55:51',NULL,14,'R22018','2023年8月驗收用','R22018',15),(22,'2023-08-29 00:56:00',NULL,14,'R22019','2023年8月驗收用','R22019',15),(23,'2023-08-29 01:06:23',NULL,14,'R23031','2023年8月驗收用','R23031',15),(900,'2022-09-13 14:39:26','2022-10-12 13:29:31',999,'R22018','題組一','Person A',15),(901,NULL,'2022-10-11 00:37:36',999,'R22019','題組二','Online shopping',15),(902,'2022-10-08 14:39:16','2022-10-11 00:37:41',999,'E22077','字典模組測試題','Later Is Better!\n\nDo you feel it\'s hard to get up early for school and even harder to listen well in the first class at 8 a.m.? Well, this happens to most of us and is not helpful for our learning!\n\nSome studies show that teenagers’ brains make melatonin, the hormone that helps sleep, between 11 p.m. and 8 a.m. So it’s better for us to sleep during these nine hours. But here comes the problem. We’re asked to get to school by 7:30 a.m. That means we have to get up before 7, when our brains should still be sleeping. That’s why we’re always so tired and can’t think clearly in early morning classes. No clear head, no good learning, right?\n\nIf we can’t change how our body works, why can’t school start later? In this way, we can not only sleep more but also learn better!',15),(903,'2023-04-24 07:09:31',NULL,999,'R23023','拍影片用','20230424拍影片用',15),(920,'2023-07-21 09:13:15','2023-07-21 09:15:45',1012,'R23035','R23035','Directions: Look at the picture. Read the sentences. Which sentence goes with the picture? Select the sentence which correctly matches the picture.\n\n子題1	\n選項1	The boy goes fishing.\n選項2	The boy goes shopping.\n選項3	The boy goes camping. *\n子題2	\n選項1	It is sunny today.\n選項2	It is rainy today. *\n選項3	It is cloudy today.\n子題3	\n選項1	My cat is under the chair. *\n選項2	My cat is on the desk.\n選項3	My cat is in the box.\n子題4	\n選項1	There are lions and elephants in the zoo.\n選項2	There are elephants and monkeys in the zoo.\n選項3	There are monkeys and lions in the zoo. *\n子題5	\n選項1	I am going to the library.\n選項2	I am going to the hospital. *\n選項3	I am going to the park.',15),(921,'2023-07-21 13:10:56',NULL,1012,'R23036','R23036','Directions: Look at the picture. Read the sentences. Which sentence goes with the picture? Select the sentence which correctly matches the picture.\n\n子題1	\n選項1	This is a classroom. *\n選項2	This is a bookstore.\n選項3	This is a restaurant.\n子題2	\n選項1	I walk the dog every day. *\n選項2	I play the guitar every day.\n選項3	I fly a kite every day.\n子題3	\n選項1	She likes watermelons and guavas.\n選項2	She likes watermelons and bananas. *\n選項3	She likes bananas and grapes.\n子題4\n選項1	My cat is by the chair.\n選項2	My cat is under the chair.\n選項3	My cat is on the chair. *\n子題5\n選項1	I go to school on foot.\n選項2	I go to school by bus.\n選項3	I go to school by bike. *',15),(922,'2023-07-22 01:07:33','2023-07-22 01:15:42',1012,'R23038','R23038','Read the note from Tim\'s parents.	  \nHey birthday boy,	\nWe didn\'t want to wake you up.	\nSorry, we\'ll be home very tonight.	\nlate*\nlong\nbusy\n\nBut we can\'t wait to give you your birthday  	\nfavor\ngift*\ntest\n\nYou will find a big box the living room.	\nin\noff*\non\n\nYour dad and I want to give you a big  	\naccident\ntopic\nsurprise*\n\nWe you\'ll like it.	\nhope*\ndoubt\nregret\nWith Love, Mom and Dad.',15),(923,'2023-07-22 12:49:26',NULL,1012,'R23039','R23039','Directions: Choose one word from the list for each gap. The first one is done for you.\n\nRead the note from Eaglewood Elementary principal to the parents.\nDear Eaglewood Families,\nWelcome back to another wonderful school year!\nAt the beginning of each year, Eaglewood always  with \"Parents\' Day.\"\nends\nstarts*\nworks\n\nThis year, the \"Parents\' Day\" will be 9:30 on September 15.\non\nin\nat*\n\nHowever, because of COVID-19,  will be an online meeting.\nthey\nit*\nwe\n\nPlease   the school website for the link.\ngo\ncheck*\nlook\n\nI look forward to meeting and working   you!\nwith*\nfrom\nto\n\nSincerely,\nKaren Shiao, principal',15),(924,'2023-07-23 05:01:24',NULL,1012,'R23041','R23041','Directions: Order the sentences to make a story. The first sentence of the story is an example. \n\nThe flying fish festival draw thousands of visitors to the Orchid Island every year.\n\nHere are two rules for visitors during their stay on this beautiful island.\n\nThe first rule is not to touch the traditional fishing boats without the fishers’ permission.\n\nTouching them without asking may bring bad luck to the local fishers.\n\nIn addition, never ask the fishers where they will go for fishing before they sail to the sea.\n\nSuch questions are believed to reduce their chances of catching flying fish.\n\nFollowing the above rules can make the trip more enjoyable during the flying fish festival.',15),(925,'2023-07-23 06:57:53',NULL,1012,'R23043','R23043','Directions: Order the sentences to make a story. The first sentence of the story is an example.\n\nI will never forget how silly I was last weekend.\n\nLast Sunday I went to a new shopping mall by myself.\n\nI was very excited to see so many new stores there.\n\nIn one of the stores, I decided to buy a box of chocolate for my family.\n\nWhile I was trying to pay for it, I couldn’t find my wallet.\n\nTo find out what went wrong with my wallet, I made a phone call to my mom.\n\nWhen she said she found it in my bedroom, I felt relieved and laughed at myself.',15),(926,'2023-07-23 22:27:21',NULL,1012,'R23047','R23047','Directions: Read the passage quickly. Choose the best heading for each numbered paragraph (1-7) from the drop-down box. There is one more heading than you need.\n\n0. Thinking is a conscious activity, which means we are aware when using our brains to make sense of the world and decide how to respond to it. Although the unconscious mind can continue working on a problem while we sleep, it is not what scientists normally call ‘thinking’. Psychologists, for example, define thinking as a purposeful mental activity. That is, when we try to reason and to connect what we sense with our inner world of understanding to actions or responses that will change the outer world, we are thinking.\n\n1. How our brain processes the information received and converts it into thoughts can be categorized into different types. One type, creative thinking, regards the production of ideas. When we think creatively, our focus is wide, and we look at many possibilities. This allows us to interpret our surroundings in novel ways and arrive at innovative solutions. Another type, critical thinking, involves the evaluation of ideas. When we think critically, our focus is narrow. We sort out the ideas generated and identify the most logical ones. This allows us to avoid biases and reach at the truth of a problem.\n\n2. Both creative and critical thinking are natural activities for human beings. However, it is difficult to do them well without training and practice. Much of our education was based on the idea that thinking can\'t be taught. Modern research proves the idea wrong. In fact, thinking can be taught to all students. This means students can get regular practice in producing and evaluating ideas when teachers make thinking skills a specific goal. \n\n3. Furthermore, the understanding of language and the concepts that it represents is central to the development of thinking processes. Language is highly symbolic, much like thinking itself. Therefore, we cannot develop complex thoughts if we are unable to interpret symbols and images. Accordingly, there is a reason for schools worldwide to ensure literacy education from a young age. If language training is absent from early education, we will be at risk of developing defective thinking patterns that can hinder success in our education, career, and other aspects in life.\n\n4. This is because good thinking skills are necessary for academic success. Most instructors do not want students to simply repeat information they have learned in lectures and readings. Successful students will analyze facts and opinions. They will synthesize information from different resources, such as books and journals, and will apply their knowledge to assignments. Students who have poor thinking skills will have difficulty making conclusions after conducting research. It will also be difficult for them to create ideas or solve problems.\n\n5. Besides academic achievement, success in work also depends on thinking skills. People who want to succeed must be able to apply what they know to the challenges of their jobs. Employers are looking for problem solvers and decision makers, not walking encyclopedias. Specifically, the ability to think creatively is sought after in situations where unconventional solutions are needed to solve unprecedented problems. On the other hand, critical thinking is appropriate whenever a statement or claim is open to question. Since such statements are made daily in almost every field of study and work, we need critical thinking to make sound judgments or decisions.\n\n6. While the ability to think creatively and critically is greatly valued in all aspects of life, authorities around the world today are encouraging schools to make critical thinking a priority. Given the fact that consuming information becomes too easy in the age of social media, critical thinking enables us to be cautious of the source of the information, its objectivity and its potential impact on readers or viewers. Take fake news as an example, if we were to place blind faith in all of the information presented to us without questioning its authenticity and intention, we would fall victim to all sorts of biases. \n\n7. In short, the ability to think and to reason is what separates humans from other species. It seems human beings by nature have a need to utilize the information in the environment in order to combat the complex challenges that we face. The better our brain processes the information that is presented to us, the more successfully we can approach the problems and seek solutions. By enhancing our skills through practice and by seeking opportunities that challenge us to be more innovative and critical in our thoughts, we can work towards being better thinkers.',15),(927,'2023-08-01 06:28:38',NULL,1012,'R23049','R23049','Directions: Read the passage quickly. \nChoose the best heading for each numbered paragraph (1-7) from the drop-down box. \nThere is one more heading than you need.\n\n0. It is no exaggeration to say that jeans are the most popular apparel item in the modern world. It is estimated that some 2 billion pairs of jeans are being sold every year worldwide and that the average woman owns 7 and man 6 pairs of jeans. Originally designed for miners, modern jeans were popularized as casual wear by Hollywood stars in the 1950s films. Nowadays, wearing jeans projects a youthful, cool and chic image, but the price we pay for such a desirable image is not just the figure on the price tag. In fact, the environmental cost for making a pair of jeans is astoundingly huge.\n1. The fabric for jeans is denim, which relies mainly on cotton. Planting cotton and producing denim consumes a disturbing amount of water. A study by Levi Strauss & Co. found that producing one pair of Levi jeans requires 3,781 liters of water. This is disturbing since over 785 million people of the world’s population do not have access to clean water. Besides, the seriousness of the problem is left upon the driest countries in the world. Pakistan, for example, has a very large cotton industry but has been experiencing a water crisis for years.\n2. Taking up about 2.5% of agricultural land, cotton farming; however, is responsible for about 16% of all the insecticides and 6.8% of all herbicides used all over the world. Pesticides are highly toxic and create a dangerous and hazardous working environment for cotton farmers. According to the World Health Organization, between 1% and 3% of agricultural workers worldwide suffer from serious pesticide poisoning with at least 1 million requiring hospitalization each year. Moreover, pesticides pollute the soil and water systems nearby, which in turn threatens food supplies and poses health risks.\n3. Labor is another problem derived from the making of denim. Cotton production has its roots in the slave trade that led to slavery in the West and has unfortunately continued to date. Today, we still find exploitative issues such as child and forced labor in Uzbekistan and India, and the inability to compete with the cost of US-subsidized cotton in West and Central Africa and Brazil, all of which are connected to cotton production and the fashion industry in general. How would these people be able to fight for their own rights while all the profits go to the big corporations?\n4. Aside from the overuse of water and the risks caused by pesticides, the denim industry requires the extensive use of harmful chemicals which are used in the dyeing process. Some of the dyes, such as Azo Dyes, are known to release cancer-inducing chemicals. These chemicals are harmful to the environment and increase the risks on a worker’s health and safety. Therefore, when shopping for jeans or any other denim products, shoppers better look for brands that use natural dyes and organic cotton to avoid funding the toxic processes.\n5. Sandblasting is a technique that achieves the cool “distressed” and weathered look on jeans. The jeans are literally blasted with sand, hence the name, to soften the fabric and wear them down. During the process the fine dust particles can lodge themselves in workers’ lungs, posing significant health risks to them. The same distressed look or result can also be achieved through stone-washing, sandpapering, brushing, or using lasers. These alternatives are less popular as they are costlier than sandblasting.\n6. Making denim softer and lighter in color also requires large amounts of water. After dyeing, the fabric needs to be rinsed with water to remove excess dye, dried and then sized, to make the yarn stronger. The dyes involve chemicals, some very toxic. They are washed off and dumped into drains and waterways. They pollute the water and the soil, further poisoning anyone who gets into contact with such water, even if they are miles away.\n7. The plain truth is that we need eco-friendly denim, and that we need to be responsible shoppers ourselves as well. Manufacturers would also take it as their social responsibility to develop or rely on recently developed technologies that take a sustainable manufacturing process. Contemporary denim is being produced in a far more responsible and sustainable manner, ensuring the final product requires less water, fewer chemicals and less energy. Attaining 100% organic and eco-friendly denim may be an unattainable dream, but little steps in that direction would bring about significant changes.\n\n\nColoring chemicals threatening human life and nature\nImmediate health threat to farmers\nA process posing a threat to lungs\nRinsing as another source of harmful effects\nEfforts into sustainable production\nAn extremely water-thirsty farming*\nA dress code beyond boundaries\nAn industry that exploits manpower\n\n\nColoring chemicals threatening human life and nature\nImmediate health threat to farmers*\nA process posing a threat to lungs\nRinsing as another source of harmful effects\nEfforts into sustainable production\nAn extremely water-thirsty farming\nA dress code beyond boundaries\nAn industry that exploits manpower\n\n\nColoring chemicals threatening human life and nature\nImmediate health threat to farmers\nA process posing a threat to lungs\nRinsing as another source of harmful effects\nEfforts into sustainable production\nAn extremely water-thirsty farming\nA dress code beyond boundaries\nAn industry that exploits manpower*\n\n\nColoring chemicals threatening human life and nature*\nImmediate health threat to farmers\nA process posing a threat to lungs\nRinsing as another source of harmful effects\nEfforts into sustainable production\nAn extremely water-thirsty farming\nA dress code beyond boundaries\nAn industry that exploits manpower\n\n\nColoring chemicals threatening human life and nature\nImmediate health threat to farmers\nA process posing a threat to lungs*\nRinsing as another source of harmful effects\nEfforts into sustainable production\nAn extremely water-thirsty farming\nA dress code beyond boundaries\nAn industry that exploits manpower\n\n\nColoring chemicals threatening human life and nature\nImmediate health threat to farmers\nA process posing a threat to lungs\nRinsing as another source of harmful effects*\nEfforts into sustainable production\nAn extremely water-thirsty farming\nA dress code beyond boundaries',15),(928,'2023-08-20 08:57:41','2023-08-20 12:48:51',1013,'R23033','A2字典測試-跨句閱讀題','Long time ago, there were two suns in the sky.\nThey took turns to come up, so there was no night time.\nMany babies were dead because it was too hot.\nA father was very sad about his baby\'s death and he wanted to take his revenge.\nBefore he left home, he grew an orange tree and said, “I will come home when the tree grows fruit.”\nThen he went away to look for the suns.\nHe finally came close to one of the suns and shot it.',15),(929,'2023-08-20 12:48:35',NULL,1013,'R23031','B1-B2 字典測試-橫式下拉閱讀題','(It\'s 10:30 AM.)\nJohn: I\'m leaving at 1:00PM. Can I check out until then?\nClerk : All customers have to check out before twelve o\'clock, or we\'ll charge for another night.\nJohn: I see. But where can I put my luggage? I don\'t think it\'s a good idea to drag my luggage with me when I go downtown for shopping.\nClerk: Oh! Don\'t worry. We have a room for your luggage. You can put it there. By the way, we have free\nshuttles to the airport. Would you like to make a reservation?\nJohn: Yes. Thanks for telling me. I want to take the shuttle leaving at one o\'clock.\nClerk: Sure!\n\n1.Where can you hear this conversation?\nA. At a hotel.\nB. At a restaurant.\nC. At an airport.\n\n2. Which of the following is true?\nA. John has to pay if he takes the shuttle.\nB. John would go shopping before he leaves for the airport.\nC. The clerk suggests John to leave at one o\'clock.',15),(930,'2023-08-20 13:07:29',NULL,1013,'R23034','A1 字典測試-句意閱讀','Elva is [[too]] heavy to run fast.\nGranny is too [[old*|| strong|| nice]] to take stairs. She must take the elevator. \nI was so [[glad|| exciting|| sick*]] last night that I didn\'t finish my homework.',15),(934,'2023-09-02 01:41:07',NULL,15,'E23150','E23150','E23150',15),(935,'2023-09-02 01:43:47',NULL,16,'E23150','E23150','E23150',15);
